import './leftPanel.css';
import React from 'react';

function LeftPanel() {
    return (
        <>
            <div id="mySidenav" class="sidenav">
                <a href="#" id="about">About</a>
                <a href="#" id="blog">Blog</a>
                <a href="#" id="projects">Projects</a>
                <a href="#" id="contact">Contact</a>
            </div>
        </>
    );
}

export default LeftPanel;
